import React, { Fragment } from 'react';
import PropTypes from 'prop-types';
import RepoItem from './RepoItem';

const Repos = ({ repos, repoNum }) => {
    let reposToMap = repos;
    console.log(
        `▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓▓`
    );
    console.log(`TYPEOF REPONUM: ${typeof repoNum}`);
    console.log(`REPOS BEFORE SLICE: ${reposToMap}`);
    reposToMap.slice(0, repoNum);
    console.log(`REPONUM AFTER SLICE: ${repoNum}`);
    console.log(`REPOS AFTER SLICE: ${reposToMap}`);
    return reposToMap.map(repo => <RepoItem repo={repo} key={repo.id} />);
};

Repos.propTypes = {
    repos: PropTypes.array.isRequired
};

export default Repos;
